image.onUp:
__ht__function(event, data, view, point, width, height) {
if(!data.ca('disabled')){
    data.ca('icon-background',data.ca('hover-background'));
    let cb = new Function('return ' + data.ca('clicked'))();
    typeof(setBindTabviewIndex) != 'undefined' && setBindTabviewIndex(data,data.ca('bindTabview'));
    let paramCb = new Function('return ' + data.ca('param'))();
    let param = paramCb ? paramCb(data,view) : null;
    if(typeof(i) != 'undefined' && typeof(i.updateBindControls) != 'undefined'){
        //240304，需要改成i.formEventBubblingUpper，否则执行操作可能会出问题！比如tab页签索引切换，切换不了！
        // i.updateBindControls(data,param,[],false,'~','clicked');//params是response的位置，所以得是对象类型\
        //触发事件连线操作
        i.formEventBubblingUpper(
            data,
            data._gv,
            data._cache,
            'clicked',
            null,
            false
        );
    }
    //230819，支持传入url，点击浏览器新窗口打开。
    let urltmp = data.ca('openUrl');
    if(urltmp && urltmp.indexOf('http') == -1) urltmp = 'http://' + urltmp;
    urltmp && window.open(urltmp,'_blank');
    return cb && cb(data,param)
}
}

image.onEnter:
__ht__function(event, data, view, point, width, height) {
if(data.ca('disabled')){
    view.getView().style.cursor = 'not-allowed'
}else{
    data.ca('icon-background',data.ca('hover-background'))
    data.iv();
    view.getView().style.cursor = 'pointer'
}
}

image.onLeave:
__ht__function(event, data, view, point, width, height) {
data.ca('icon-background',data.ca('default-background'))
view.getView().style.cursor = 'default'
}

image.renderHTML:
__ht__function(data, gv, cache) {/*240304，所以渲染元素最简，都需要加上这句调用，否则连线赋值时，判断
i.hasInnerSymbolInited()识别渲染元素是否初始化就极可能识别判断失误！
加上了这句，上面的data._gv、data._cache散装调用貌似可以去掉了，暂时
不动，留着也无妨！*/
cache = _i.innerRecoveredDataCache(data, cache,false,'cbtn','图片按钮');

//对于提示组件，初始没有配置（undefined），那么自动勾选，允许运行时提示可见！
if(data.getName() == 'tip' && data.ca('toolTip') === undefined){
    data.ca('toolTip',true);
    data.s('pixelPerfect',false);
}

//240518，清空时，给一个矩形，可以配置颜色包括透明的，避免清理不掉默认图标。当清理图标时，自动矩形半透明0.1
if(!data._gv){
    i.md(data, gv, cache, {
        'a:path': e => {
            if(!e.newValue || e.newValue.trim() == ''){
                data.ca('path','symbols/develop/uiotos/common/pureRect.json');
                data.ca('default-background', rgbaForced(data.ca('default-background'),0.1));
                data.ca('hover-background', rgbaForced(data.ca('hover-background'),0.1));
                data.ca('click-background', rgbaForced(data.ca('click-background'),0.1));
                data.s('image.stretch','fill');
            }
        },
    }, [], null, null, null);
}

//240304，发现iconButton图片按钮没有渲染元素代码实现，需要这里手动加
data._gv = gv;
data._cache = data.__cache = cache;}

name.func:
__ht__function(data, view) {
function func(data,view){
    if((typeof(runningMode) != 'undefined' && !runningMode()) || view.getView().style.cursor != 'pointer'){//最好不用 == 'default'，因为存在代码初始赋值
        data.ca('icon-background',data.ca('default-background'))
    }
    var typeArr = ['light','light','regular','light'] //枚举下拉选择
    var typetmp = typeArr[data.ca('iconType')] //类型选择
    var path = data.ca('path')                 //图标路径
    if(path != undefined && path.trim() !== ''){
        if(path.indexOf('.') == -1){           //传入图标文件名称时
            path = 'symbols/demo/uiotos/icons/' + typetmp + '/' + path + '.json'
        }else if(path.indexOf(typetmp) == -1){ //图标类型发生变化时
            typeArr.forEach((curType,index)=>{
                if(curType != typetmp){        //路径中先前的类型名称换成新的
                    path = path.replace(curType,typetmp)               
                }
            })
        }
    }
    data.ca('path',path)                      //回写过去
    return path
}

//整体复制的话需要带上这句，因为属性func外层已经是函数体
return func(data,view)
}

